import React from 'react'

function Header() {
  return (
    <>
      <div className="header">
          <div className="branding"><span class="menu_toggle"></span>Driver Assignment</div>
          <div className="search_bar"></div>
          <div className="user_panel"></div>
      </div>
    </>
  )
}

export default Header
